import React, { Component } from 'react';
class RecentlyDocument extends Component {
    render() { 
        return (  
            <div className="d-block" style={{marginTop : '3%'}}>
                <p className="h4 mb-2 text-dark text-center">Recently Document</p>
                <img className="d-inline-block" src={teamLogoImg}></img>
            </div>
        );
    }
}
const containerStyle = {
    paddingRight : '15%',
    paddingLeft : '15%'
};
const imageStyle = {
    width : "10%",
    height : "10%"
}
const teamLogoImg = require('../Resources/court-logo.png');
export default RecentlyDocument
